import { useState, useEffect } from "react";
import "./App.css";
import styled from "styled-components";
import { FiEye } from "react-icons/fi";
import Spinner from "./Components/Spinner";

const importData = async () => import("./trajectoires.json");

// const Wrapper = styled.div`
//   width: 100vw;
//   height: 100vh;
//   background: #282c34;
// `;

const Main = styled.div`
  // display: flex;
  padding: 2em;
  color: snow;
`;

const Title = styled.h1`
  display: flex;
  align-items: center;
`;

function App() {
  const [data, setData] = useState(null);

  useEffect(() => {
    // Setting the data state asynchronously
    // in case of huge dataset import
    // we're able to display a loader
    importData().then(({ default: def, ...rest }) => setData(rest));
  }, []);

  return !data ? (
    <Spinner />
  ) : (
    <Main>
      <Title>
        <FiEye style={{ marginRight: "10px" }} />
        Lil Brother
        <Spinner inline />
        {Object.keys(data).length}
      </Title>

      {/* {data[0].id} */}

      {/* {data.map((item, index) => (
            <div key={index}>{item.id}</div>
          ))} */}

      {JSON.stringify(data)}
    </Main>
  );
}

export default App;
